import "./App.css";
import Lenguajes from "./Lenguajes";
import Body from "./Body";

function App() {
  return (
    <div className="App">
      <Body />
      <Lenguajes />
    </div>
  );
}

// Cambiar el título y la descripción de la página
document.title = "Desarrollador Web Freelance - Creación y Diseño de Páginas Web";
document.querySelector('meta[name="description"]').setAttribute(
  "content",
  "Desarrollador web freelance especializado en la creación y diseño de páginas web. Ofrezco soluciones personalizadas para tu presencia en línea. Contáctame para proyectos de desarrollo y diseño web."
);

// Palabras clave (keywords) SEO
document.querySelector('meta[name="keywords"]').setAttribute(
  "content",
  "desarrollador web freelance, diseño de páginas web, creación de sitios web, desarrollo web personalizado, presencia en línea, diseño de interfaces, sitio web profesional, programación frontend, programación backend, diseño responsivo"
);

export default App;
